   INSERT INTO `book` VALUES 
	(17,'Advanced Techniques in React.js','Mary','This book is designed for beginners who have some knowledge of HTML, CSS, and JavaScript. It covers the basics of React, including components, JSX, and state management. The book also includes an introduction to Redux and covers how to build a complete web application using React and Redux in advance!', 10, 10, 'FE', 'data:image/png;base64,'),
	(18,'Introduction to C#','Bill','Programming C# teaches this new language in a way that experienced programmers will appreciate--by grounding its applications firmly in the context of Microsoft. NET platform and the development of desktop and Internet applications.', 12, 12, 'BE', 'data:image/png;base64,'),
	(19,'Crash Course in JavaScript','Frank','JavaScript is a lightweight interpreted programming language. The web browser receives the JavaScript code in its original text form and runs the script from that. From a technical standpoint, most modern JavaScript interpreters actually use a technique called just-in-time compiling to improve performance; the JavaScript source code gets compiled into a faster, binary format while the script is being used, so that it can be run as quickly as possible.This book is much helpful!.', 20, 20, 'FE','data:image/png;base64,'),
    (20,'Introduction to Machine Learning','Megha Kamble','The First Edition of the book An Introduction to Machine Learning combines theory and practice, explaining important methods such as classical linear and logistic regression, deep learning, and neural network with a detailed explanation, all variants of models, suitable examples, and Python code snippets.', 20, 20, 'Data','data:image/png;base64,'),
	(21,'Introduction to Java Programming','K SOMASUNDARAM','This book is intended for a one-semester, beginners level course on Java programming. It includes the new features included in JDK1.7. Each of its 16 chapters provide review questions for the readers to self-test their learning.Try It Out programs that enable the readers to develop programs for real life problems have also been included. Introduction to Java Programming will help budding programmers solidify their foundation on Java and move on to higher level topics like Swing, JDBC, Servlets etc. Key Features Simple presentation with an in-depth explanation of concepts up to the required level Complete programs provided for each concept.', 20, 20, 'BE','data:image/png;base64,'),
	(22,'Introduction to Python','Juan', 'Introduction to Python Programming is written for students who are beginners in the field of computer programming. The contents of the book are chosen with utmost care after analyzing the syllabus for Python course prescribed by various top universities in USA, Europe, and Asia. Since the prerequisite know-how varies significantly from student to student, the books overall overture addresses the challenges of teaching and learning of students which is fine-tuned by the authors experience with large sections of students. This book uses natural language expressions instead of the traditional shortened words of the programming world. We have tried our best to write this book in such a way that students will not only find it readable but also want to read it. This book has been written with the goal to provide students with a textbook that can be easily understood and to make a connection between what students are learning and how they may apply that knowledge.', 20, 20, 'BE', 'data:image/png;base64,');
